import axios from 'axios';


import './App.scss';

const App = () => {
  const [data, setData] = useState([])

  useEffect(() => {
    axios.get('http:/localhost:3004')
    .then(setData)
    .catch(err => console.log('Error -->', err))
  }, [])

  console.log(data)
  return (
    <div className="app">
      <span>Oi</span>
    </div>
  )
}

export default App;
